import './App.css';


function App() {
  return (
    <>
    <nav className="navbar navbar-dark bg-success">
            <div className="container-fluid">
                <div className="navbar-header">
                    <a className="navbar-brand" href="#">Navigate_to</a>
                </div>
                <ul className="nav navbar-nav" >
                    <li className="nav-link"><a href="home.html">Home</a></li>
                    <li className="nav-link"><a href="project.html">Projects</a></li>
                    <li className="nav-link"><a href="education.html">Education</a></li>
                    <li className="nav-link"><a href="assignments.html">Assignments</a></li>
                </ul>
            </div>
        </nav>
    </>
  );
}

export default App;
